			ushort usetype = (type > TileDatas.Keys.Max()) ? TileDatas.Keys.Max() : type;
			if (TileDatas.TryGetValue(usetype, out var data))
			{
				return data;
			}
			else
			{
				throw new ArgumentOutOfRangeException(nameof(type), $"Missing tile data: {type}");
			}
		}

